import React, { useState, useEffect } from "react";
import Form from "./components/Form";
import { Card } from "./components/Card/Card";

import { GridItem, GridContainer } from "./components/Grid";
import Table from "./components/TabelData";

function App() {
  const [data, setData] = useState([{}]);
  const [message, setMessage] = useState({});
  const [visible, setVisible] = useState(false);
  useEffect(() => {
    fetch("/members")
      .then((res) => res.json())
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);

  useEffect(() => {
    fetch("/home")
      .then((res) => res.json())
      .then((value) => setMessage(value));
  }, []);

  const showData = () => {
    return setVisible(true);
  };

  return (
    <div>
      {message.name}
      <Form userInput={""} onFormChange={""} onFormSubmit={""} />
      <button onClick={showData}>click here</button>
      {visible ? (
        typeof data.members === "undefined" ? (
          <p>Loading...</p>
        ) : (
          data.members.map((member, i) => <p key={i}> {member}</p>)
        )
      ) : null}
      <div style={{ marginTop: "-100px" }}>
        <GridContainer style={{ padding: "100px" }}>
          <GridItem>
            <Card>
              <CardHeader color="primary">
                <h4>Sample Complains</h4>
              </CardHeader>
              <CardBody>
                <Table />
              </CardBody>
            </Card>
          </GridItem>
        </GridContainer>
      </div>
    </div>
  );
}

export default App;
